function Nav({dogs}) {

 console.log(dogs, 'dogs')

  return (
    <ul className='nav'>
      {
        dogs.map((dog,i)=>(
          <li className='nav-item' key={i}>{dog.name}</li>
        ))
      }
    </ul>
  )
}

export default Nav
